// Get all items from the previous node ('Get History from Sheet').
const allItems = $input.all();

// Get the target userId and limit from the initial webhook trigger.
const webhookData = $('Webhook: History Request').first().json.body;
const targetUserId = webhookData.userId;
const limit = webhookData.limit || 30;

// 1. Filter items for the target user.
// NOTE: We check for 'userId' (correct) and 'userid' (from your sheet) to be safe.
const userItems = allItems.filter(item => {
  const currentUserId = item.json.userId || item.json.userid;
  return currentUserId === targetUserId;
});

// 2. Sort items by createdAt descending to get the most recent ones.
const sortedDesc = userItems.sort((a, b) => new Date(b.json.createdAt) - new Date(a.json.createdAt));

// 3. Limit to the specified number of records.
const limitedItems = sortedDesc.slice(0, limit);

// 4. Sort again by createdAt ascending for the time series plot.
const sortedAsc = limitedItems.sort((a, b) => new Date(a.json.createdAt) - new Date(b.json.createdAt));

// Format as time series data points for Wolfram Alpha.
const dataPoints = sortedAsc
  .filter(item => {
    const v = item.json.valence;
    return v !== null && v !== undefined && v !== '';
  })
  .map(item => {
    const date = new Date(item.json.createdAt);
    // IMPORTANT: Ensure the date is correctly formatted
    const dateStr = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}-${String(date.getDate()).padStart(2, '0')}`;
    const valenceNum = parseFloat(item.json.valence);
    return `{"${dateStr}", ${valenceNum}}`;
  }).join(', ');

// Create Wolfram Alpha time series plot query.
const wolframQuery = `time series plot {${dataPoints}}`;

// Return the query string and the history data.
return [{
  json: {
    wolframTimeSeriesQuery: wolframQuery,
    history: sortedAsc.map(i => i.json)
  }
}];
